import React, { useState } from 'react';
import { FaGithub, FaLinkedin, FaTwitter, FaLink } from 'react-icons/fa';
import { ReactComponent as LeetCodeIcon } from '../../assets/icons/leetcode.svg';

const ProfileDetails = ({ formData, onChange, onSocialLinkChange }) => {
  const [showGithub, setShowGithub] = useState(false);
  const [showLinkedIn, setShowLinkedIn] = useState(false);
  const [showTwitter, setShowTwitter] = useState(false);
  const [showOther, setShowOther] = useState(false);
  const [showLeetCode, setShowLeetCode] = useState(false);

  return (
    <div className="bg-gray-800 p-4 rounded-md">
      <h2 className="text-xl mb-4">Personal Information</h2>
      <form>
        <div className="mb-2">
          <label className="block mb-1">Name</label>
          <input
            type="text"
            name="name"
            value={formData.name}
            onChange={onChange}
            className="w-full p-2 rounded-md bg-gray-700 border border-gray-600"
          />
        </div>
        <div className="mb-2">
          <label className="block mb-1">A Short Bio</label>
          <input
            type="text"
            name="bio"
            value={formData.bio}
            onChange={onChange}
            className="w-full p-3 rounded-md bg-gray-700 border border-gray-600"
          />
        </div>
        <div className="mb-2">
          <label className="block mb-1">Email</label>
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={onChange}
            className="w-full p-2 rounded-md bg-gray-700 border border-gray-600"
          />
        </div>
        <div className="mb-2">
          <label className="block mb-1">Location</label>
          <input
            type="text"
            name="location"
            value={formData.location}
            onChange={onChange}
            className="w-full p-2 rounded-md bg-gray-700 border border-gray-600"
          />
        </div>
      </form>

      <h2 className="text-xl mt-4 mb-4">Social Links</h2>
      <div className="flex space-x-4">
        <button onClick={() => setShowGithub(!showGithub)} className="bg-gray-700 p-2 rounded-md">
          <FaGithub />
        </button>
        <button onClick={() => setShowLinkedIn(!showLinkedIn)} className="bg-gray-700 p-2 rounded-md">
          <FaLinkedin />
        </button>
        <button onClick={() => setShowTwitter(!showTwitter)} className="bg-gray-700 p-2 rounded-md">
          <FaTwitter />
        </button>
        <button onClick={() => setShowOther(!showOther)} className="bg-gray-700 p-2 rounded-md">
          <FaLink />
        </button>
        <button onClick={() => setShowLeetCode(!showLeetCode)} className="bg-gray-700 p-2 rounded-md">
          <LeetCodeIcon width="24" height="24" />
        </button>
      </div>

      {showGithub && (
        <div className="mt-4">
          <label className="block mb-1">GitHub Username</label>
          <input
            type="text"
            value={formData.github}
            onChange={(e) => onSocialLinkChange(e, 'github')}
            className="w-full p-2 rounded-md bg-gray-700 border border-gray-600"
          />
        </div>
      )}

      {showLinkedIn && (
        <div className="mt-4">
          <label className="block mb-1">LinkedIn URL</label>
          <input
            type="text"
            value={formData.linkedin}
            onChange={(e) => onSocialLinkChange(e, 'linkedin')}
            className="w-full p-2 rounded-md bg-gray-700 border border-gray-600"
          />
        </div>
      )}

      {showTwitter && (
        <div className="mt-4">
          <label className="block mb-1">Twitter URL</label>
          <input
            type="text"
            value={formData.twitter}
            onChange={(e) => onSocialLinkChange(e, 'twitter')}
            className="w-full p-2 rounded-md bg-gray-700 border border-gray-600"
          />
        </div>
      )}

      {showOther && (
        <div className="mt-4">
          <label className="block mb-1">Other URL</label>
          <input
            type="text"
            value={formData.other}
            onChange={(e) => onSocialLinkChange(e, 'other')}
            className="w-full p-2 rounded-md bg-gray-700 border border-gray-600"
          />
        </div>
      )}

      {showLeetCode && (
        <div className="mt-4">
          <label className="block mb-1">LeetCode Username</label>
          <input
            type="text"
            value={formData.leetcode}
            onChange={(e) => onSocialLinkChange(e, 'leetcode')}
            className="w-full p-2 rounded-md bg-gray-700 border border-gray-600"
          />
        </div>
      )}
    </div>
  );
};

export default ProfileDetails;
